def composite_nums_between_indices(nums):
    def is_composite(n):
        if n < 2: 
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return True
        return False

    return set(num for num in nums[2:3] if is_composite(num))
